description:
A stranger named Silas flees from a devastating storm and finds refuge with Tom and Gillian on their farm.

While struggling with the Storm, Silas seems to be the only one who can help Tom and Gillian to find their son but there are other more dangerous forces out there, that are waiting for the three.
